import React from 'react'
import axios from 'axios'

export function ViewList(){

  axios.get('http://localhost:8000/list').then(
    res=>{
      console.log(res)
      var list = res.map((entry) =>
        <li key={entry.num}>
          {entry}
        </li>
      );
    }
  )
  return (
  <div>
      <ul>{list}</ul>
  </div>
  )
}
export default ViewList
